import stylePackages from "./Packages.module.css";
const Packages = () => {
  return (
    <div className={stylePackages.bodyPackages}>
      <h2>s</h2>
      <p>hs</p>
      <section>
        <div>
          <div></div>
          <div>
            <h3>s</h3>
            <p>ss</p>
            <p>s</p>
            <p>s</p>
            <p>s</p>
            <p>s</p>
            <p>s</p>
            <p>s</p>
            <button></button>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Packages;
